import React from "react";
import styles from "./styles.module.css";
import { Button, Form, FormGroup, Label, Input, FormText } from "reactstrap";

function form() {
  return (
    <form>
      <FormGroup>
        <Input
          type="email"
          className="form-control-plaintext "
          name="email"
          type="search"
          placeholder="with a placeholder"
        />
      </FormGroup>
    </form>
  );
}

export default form;
